import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on profile button (using class selector)
    await page.waitForSelector('.profile-btn', { timeout: 5000 });
    await page.click('.profile-btn');

    // Wait for profile modal to appear
    await page.waitForSelector('#profileModal', { timeout: 5000 });

    // Take screenshot of the profile modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_modal.png'));

    // Click on "Edit profile" button (using class selector)
    await page.waitForSelector('.edit-profile-btn', { timeout: 5000 });
    await page.click('.edit-profile-btn');

    // Wait for editing interface to load
    await page.waitForSelector('.edit-profile-interface', { timeout: 5000 });

    // Take screenshot of the edit profile interface
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_edit_profile_interface.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_edit_profile_interface.png'));

    return {
      success: true,
      action: "Successfully navigated to the edit profile interface",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
